import ExpensesItem from './ExpensesItem';
import Card from './Card'
import './Expenses.css'

function Expenses(props){
    return (
        <Card className="expenses">
          <ExpensesItem
            title = {props.items[0].title}
            amount = {props[0].amount}
            date = {props[0].date}
          ></ExpensesItem>
          <ExpensesItem
            title = {props[1].title}
            amount = {props[1].amount}
            date = {props[1].date}
          ></ExpensesItem>
          <ExpensesItem
            title = {props[2].title}
            amount = {props[2].amount}
            date = {props[2].date}
          ></ExpensesItem>
          <ExpensesItem
            title = {props[3].title}
            amount = {props[3].amount}
            date = {props[3].date}
          ></ExpensesItem>
        </Card>
    )
}

export default Expenses;
